import './ElementCont.css'

function ElementCont(props){
    return (
        <div id="ElementCont" style={{
            backgroundColor: (props.color ? props.color : '#C6DBCA'),
            border: (props.color ? props.color : '#48A859') + ' .5em solid'
        }}>
            <div id="contTitle" style={{
                backgroundColor: (props.color ? props.color : '#48A859')
            }}>{props.title}</div>
            {props.children}
            <div id="stats"></div>
        </div>
    )
}

export default ElementCont
